import React from 'react';
import classes from './ServiceSideMenu.module.css';
import {Link} from 'react-router-dom';

const serviceSideMenu = (props) => {
    const links = props.services.map(service => {
        const modifiedName = service.replace("_"," ");
        return (<Link to="/service">{modifiedName}</Link>)
    })
    return (
        <div>
            {links}
        </div>
    );
}

export default serviceSideMenu;
